import React from 'react';
import { Link } from 'react-router-dom';

function Nav() {
    return (
        <div>
            <nav id="navbar">
                <ul>
                    <li><Link to="/design-and-programming">programming</Link></li>
                    <li><Link to="/about-myself">about me</Link></li>
                </ul>  
                <ul>  
                    <li><Link to="/beau-ye-roc">beau yé roc</Link></li>
                    <li class="not-ready">roy haes</li>
                    <li><a href="https://forumcache.xyz" target="_blank" rel="noopener noreferrer">forum cache®</a></li>
                </ul>
                <ul>
                    <li>inquiries</li>
                </ul>
            </nav>
        </div>
    )
}

export default Nav;
